import {useRef} from 'react';

function Layout(props) {
  const frame = useRef(null);
  return (
    <section className={`content ${props.name}`} ref={frame}>
      <figure></figure>
      <div className="inner">
        <h1>{props.name}</h1>
        {props.children}
      </div>
    </section>
  );
}
export default Layout;
